import './App.css';
import logo from  './logo_biblioteca.jpg';
import SearchBar from './components/SearchBar';
import icon_perfil from './icon_perfil.jpg';

console.log(icon_perfil);

console.log(logo);

function App() {
  return (

    <div className='container'>

     <div className='logo'> 
     <button class="btn btn-outline-light text-dark" href="#" type="button"><img src={logo} width='65' alt= 'Logo'/></button>
     </div>

      <div className='header'><SearchBar/></div>

      <div className='profile'>    
        <button type="button" class="btn dropdown-toggle" data-bs-toggle="dropdown"><img src={icon_perfil} width='65' alt= 'Icon_Perfil'/> </button>
        <div class="dropdown-menu">
        <a class="dropdown-item" href="#">Sign in</a>
        <a class="dropdown-item" href="#">Sign up</a>

        </div>
      </div>

      <div className='content'> content </div>


    </div>

  );
}


export default App;
